import React from "react";
import { Row, Col } from "reactstrap";
export default class Splash extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <section className="splash">
        <Row className="w-100">
          <Col className="w-50">
            <img
              className="splash-1"
              src="/static/images/splash-1.jpg"
            />
          </Col>
          <Col >
            <img
              className="splash-2"
              src="/static/images/splash-2.jpg"
            />
          </Col >
        </Row>
        <button className="button-1">&lt;</button>
        <button className="button-2">&gt;</button>
      </section>
    );
  }
}
